import React from 'react'
import { Header } from './components/header/Header';
import { SectionImg } from './components/sectionimg/SectionImg';
import { SectionVideo } from './components/sectionVideo/SectionVideo';
import { CardLarge } from './components/cardLarge/CardLarge';
import Accordion from "./components/faqs/Accordion";
import data from './data/data';
  

function App() {
  return (
    <>
      <Header/>
      <SectionVideo
        title={<div dangerouslySetInnerHTML={{ __html: data.s1.title }} />}
        content={<div dangerouslySetInnerHTML={{ __html: data.s1.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s1.imgPosition}} />} 
      />        
      <SectionImg 
        img={<div dangerouslySetInnerHTML={{ __html: data.s2.img}} />} 
        title={<div dangerouslySetInnerHTML={{ __html: data.s2.title}} />} 
        content={<div dangerouslySetInnerHTML={{ __html: data.s2.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s2.imgPosition}} />} 
      />
      <SectionImg 
        img={<div dangerouslySetInnerHTML={{ __html: data.s3.img}} />} 
        title={<div dangerouslySetInnerHTML={{ __html: data.s3.title}} />} 
        content={<div dangerouslySetInnerHTML={{ __html: data.s3.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s3.imgPosition}} />} 
      />
      <SectionImg 
        img={<div dangerouslySetInnerHTML={{ __html: data.s4.img}} />} 
        title={<div dangerouslySetInnerHTML={{ __html: data.s4.title}} />} 
        content={<div dangerouslySetInnerHTML={{ __html: data.s4.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s4.imgPosition}} />} 
      />
      <SectionImg 
        img={<div dangerouslySetInnerHTML={{ __html: data.s5.img}} />} 
        title={<div dangerouslySetInnerHTML={{ __html: data.s5.title}} />} 
        content={<div dangerouslySetInnerHTML={{ __html: data.s5.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s5.imgPosition}} />} 
      />
      <CardLarge 
        img={<div dangerouslySetInnerHTML={{ __html: data.cardL1.img}} />}
        href={<div dangerouslySetInnerHTML={{ __html: data.cardL1.href}} />}
        title={<div dangerouslySetInnerHTML={{ __html: data.cardL1.title}} />}
      />
      <SectionImg 
        img={<div dangerouslySetInnerHTML={{ __html: data.s6.img}} />} 
        title={<div dangerouslySetInnerHTML={{ __html: data.s6.title}} />} 
        content={<div dangerouslySetInnerHTML={{ __html: data.s6.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s6.imgPosition}} />} 
      />
      <CardLarge 
        img={<div dangerouslySetInnerHTML={{ __html: data.cardL2.img}} />}
        href={<div dangerouslySetInnerHTML={{ __html: data.cardL2.href}} />}
        title={<div dangerouslySetInnerHTML={{ __html: data.cardL2.title}} />}
      />
      <SectionImg 
        img={<div dangerouslySetInnerHTML={{ __html: data.s7.img}} />} 
        title={<div dangerouslySetInnerHTML={{ __html: data.s7.title}} />} 
        content={<div dangerouslySetInnerHTML={{ __html: data.s7.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s7.imgPosition}} />} 
      />
      <CardLarge 
        img={<div dangerouslySetInnerHTML={{ __html: data.cardL3.img}} />}
        href={<div dangerouslySetInnerHTML={{ __html: data.cardL3.href}} />}
        title={<div dangerouslySetInnerHTML={{ __html: data.cardL3.title}} />}
      />
      <SectionImg 
        img={<div dangerouslySetInnerHTML={{ __html: data.s8.img}} />} 
        title={<div dangerouslySetInnerHTML={{ __html: data.s8.title}} />} 
        content={<div dangerouslySetInnerHTML={{ __html: data.s8.content}} />} 
        imgPosition={<div dangerouslySetInnerHTML={{ __html: data.s8.imgPosition}} />} 
      />
      <CardLarge 
        img={<div dangerouslySetInnerHTML={{ __html: data.cardL4.img}} />}
